import React from 'react';

function Skills() {
  return (

    <div className="section">
      <h2>My Skills</h2>
      <ul className="skills-list">
        <li>HTML</li>
        <li>CSS</li>
        <li>JavaScript</li>
        <li>React.js</li>
        <li>Git & GitHub</li>
        <li>Responsive Design</li>
      </ul>
    </div>
  );
}

export default Skills;
